import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

const App = () => {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [isMenuOpen, setIsMenuOpen] = useState(false); // Track if the menu is open

  // Fetch courses from the backend
  useEffect(() => {
    fetch("http://localhost:5000/api/courses") // Your backend endpoint
      .then((response) => response.json())
      .then((data) => {
        setCourses(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching courses:", error);
        setLoading(false);
      });
  }, []);

  // Toggle the hamburger menu
  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <Router>
      <div className="App">
        {/* Hamburger Menu */}
        <div className="hamburger-menu-container">
          <div className="hamburger" onClick={toggleMenu}>
            <span className="bar"></span>
            <span className="bar"></span>
            <span className="bar"></span>
          </div>
        </div>

        {/* Dropdown Menu (Appears when hamburger is clicked) */}
        {isMenuOpen && (
          <ul className="dropdown-menu">
            <li>
              <Link to="/" onClick={toggleMenu}>
                Home
              </Link>
            </li>
            <li>
              <Link to="/login" onClick={toggleMenu}>
                Login
              </Link>
            </li>
            <li>
              <Link to="/subscription" onClick={toggleMenu}>
                Subscription
              </Link>
            </li>
            <li>
              <Link to="/account" onClick={toggleMenu}>
                Account
              </Link>
            </li>
            <li>
              <Link to="/my-courses" onClick={toggleMenu}>
                My Courses
              </Link>
            </li>
            <li>
              <Link to="/contact" onClick={toggleMenu}>
                Contact
              </Link>
            </li>
          </ul>
        )}

        {/* Routes */}
        <Routes>
          {/* Home Page */}
          <Route
            path="/"
            element={
              <div>
                <h1>Course Recommendations</h1>
                <div className="course-list">
                  {loading ? (
                    <p>Loading courses...</p>
                  ) : (
                    courses.map((course) => (
                      <div key={course.id} className="course-card">
                        <img
                          src={course.imageUrl}
                          alt={course.title}
                          className="course-image"
                        />
                        <h2>{course.title}</h2>
                        <p>{course.description.slice(0, 50)}...</p>
                      </div>
                    ))
                  )}
                </div>
              </div>
            }
          />

          {/* Additional Routes */}
          <Route path="/login" element={<h2>Login Page</h2>} />
          <Route path="/subscription" element={<h2>Subscription Page</h2>} />
          <Route path="/account" element={<h2>Account Page</h2>} />
          <Route path="/my-courses" element={<h2>My Courses</h2>} />
          <Route path="/contact" element={<h2>Contact Page</h2>} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
